INSERT INTO `v1_fc13ee7d456121e30d44f0357f969ac2bf55580bdf9c61d14f5a7bcb556d8002` VALUES ("vo_minigame_1013_icon_1_002_001", "vo_minigame_1013_icon_2_002_001", 1, 2, 3000, 2, "訓練はまだ\nここからですわ", 2, 1000, "調子が上がって\nきたなっ");
INSERT INTO `v1_fc13ee7d456121e30d44f0357f969ac2bf55580bdf9c61d14f5a7bcb556d8002` VALUES ("vo_minigame_1013_icon_1_003_001", "vo_minigame_1013_icon_2_003_001", 2, 2, 3000, 2, "クスクス、悪くない\n流れですわね", 2, 5000, "ほらほら、\nまだいけるだろ？");
INSERT INTO `v1_fc13ee7d456121e30d44f0357f969ac2bf55580bdf9c61d14f5a7bcb556d8002` VALUES ("vo_minigame_1013_icon_1_004_001", "vo_minigame_1013_icon_2_004_001", 3, 3, 3000, 2, "すばらしい\n記録ですわ", 2, 10000, "へへっ、おまえら\nやるじゃねえか！");
INSERT INTO `v1_fc13ee7d456121e30d44f0357f969ac2bf55580bdf9c61d14f5a7bcb556d8002` VALUES ("vo_minigame_1013_icon_1_005_001", "vo_minigame_1013_icon_2_005_001", 4, 3, 3000, 3, "乗りに乗って\nいますわね", 2, 10000, "あたしたちはまだ\n止まらねえぜ！");
