INSERT INTO `v1_fc13ee7d456121e30d44f0357f969ac2bf55580bdf9c61d14f5a7bcb556d8002` VALUES ("vo_minigame_1013_icon_1_005_003", "vo_minigame_1013_icon_2_005_003", 6, 3, 3000, 3, "エリコ班の\n本領発揮ですわ！", 2, 10000, "うおぉぉっ！\n絶好調だぜ！");
